  //       value={searchValue}
  //       onChange={(e) => setSearchValue(e.target.value)}
  //       placeholder="Search..."
  //     />

  //     <ul>
  //       {data.map((item) => (
  //         <li key={item.id} id={item.id}>{item.name}</li>
  //       ))}
  //     </ul>
  //   </div>
  // );
  return (
    <div>
      {data.length > 0 ? (
        <ul>
          {data.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );

}

export default App;
